import React, { useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";

function AddTravels({ fetch }) {
  const [title, setTitle] = useState("");
  const [story, setStory] = useState("");
  const [visitedLocation, setVisitedLocation] = useState("");
  const [isFavourite, setIsFavourite] = useState("");
  const [coverImage, setCoverImage] = useState("");
  const [visitedDate, setVisitedDate] = useState("");
  const [createdOn, setCreatedOn] = useState("");
  const navigate = useNavigate();

  const addTravel = () => {
    const token = localStorage.getItem("token");
    const travelData = {
      title,
      story,
      visitedLocation,
      isFavourite,
      coverImage,
      visitedDate,
      createdOn,
    };

    axios
      .post("http://localhost:8000/api/travel/addTravel", travelData, {
        headers: {
          Authorization: `Bearer ${token}`,
        },
      })
      .then(() => {
        console.log("Travel added successfully");
        console.log();
        
        fetch(); // Re-fetch the travel list
        navigate("/main"); // Redirect to main page
      })
      .catch((error) => {
        console.error("Error adding travel:", error);
      });
  };

  return (
    <div className="container">
      <nav className="navbar navbar-expand-lg bg-body-tertiary custom-navbar">
        <div className="container-fluid">
          <a className="navbar-brand custom-navbar-brand" href="#">
            Navbar
          </a>
          <button
            className="navbar-toggler"
            type="button"
            data-bs-toggle="collapse"
            data-bs-target="#navbarSupportedContent"
            aria-controls="navbarSupportedContent"
            aria-expanded="false"
            aria-label="Toggle navigation"
          >
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarSupportedContent">
            <ul className="navbar-nav me-auto mb-2 mb-lg-0">
              <li className="nav-item">
                <a
                  className="nav-link active custom-nav-link"
                  aria-current="page"
                  href="#"
                  onClick={() => navigate("/main")}
                >
                  Home
                </a>
              </li>
              <li className="nav-item">
                <a className="nav-link active custom-nav-link">Add Book</a>
              </li>
              <li className="nav-item">
                <a
                  className="nav-link active custom-nav-link"
                  onClick={() => navigate("/login")}
                >
                  Logout
                </a>
              </li>
            </ul>
          </div>
        </div>
      </nav>
      <form className="custom-form">
        <div className="form-outline mb-4">
          <input
            type="text"
            className="form-control custom-input"
            placeholder="Title"
            value={title}
            onChange={(e) => setTitle(e.target.value)}
          />
        </div>

        <div className="form-outline mb-4">
          <input
            type="text"
            className="form-control custom-input"
            placeholder="Description"
            value={story}
            onChange={(e) => setStory(e.target.value)}
          />
        </div>

        <div className="form-outline mb-4">
          <input
            type="text"
            className="form-control custom-input"
            placeholder="Location"
            value={visitedLocation}
            onChange={(e) => setVisitedLocation(e.target.value)}
          />
        </div>

        <div className="form-outline mb-4">
          <input
            type="text"
            className="form-control custom-input"
            placeholder="Favourite (true/false)"
            value={isFavourite}
            onChange={(e) => setIsFavourite(e.target.value)}
          />
        </div>

        <div className="form-outline mb-4">
          <input
            type="text"
            className="form-control custom-input"
            placeholder="Cover Image URL"
            value={coverImage}
            onChange={(e) => setCoverImage(e.target.value)}
          />
        </div>

        <div className="form-outline mb-4">
          <input
            type="date"
            className="form-control custom-input"
            placeholder="Visited Date"
            value={visitedDate}
            onChange={(e) => setVisitedDate(e.target.value)}
          />
        </div>

        <div className="form-outline mb-4">
          <input
            type="date"
            className="form-control custom-input"
            placeholder="Created On"
            value={createdOn}
            onChange={(e) => setCreatedOn(e.target.value)}
          />
        </div>

        <button
          type="button"
          className="btn btn-primary btn-block custom-btn"
          onClick={addTravel}
        >
          Add Book
        </button>
      </form>
    </div>
  );
}

export default AddTravels;
